import './Widget.css';

export const Widget = () => {

    const handleRadius = (event) => {
        console.log(event.target.value);
    }

    return (
        <div className="map-widget">
            <div>
                <label htmlFor="intensity">Intensity</label>
                <input id="intensity" name="intensity" type="range" min={0} max={10}/>
            </div>
            <div>
                <label htmlFor="radius">Radius</label>
                <input id="radius" name="radius" type="range" min={0} max={10} onChange={(event) => handleRadius(event)}/>
            </div>
            <div>
                <label htmlFor="threshold">Threshold</label>
                <input id="threshold" name="threshold" type="range" min={0} max={10}/>
            </div>
        </div>
    )
}
